import React from 'react';
import ImageGallery from 'react-image-gallery';

const images = [
  {
    original: 'images/bar6.jpg',
    thumbnail: 'images/bar6.jpg',
    description: 'Description de l\'image 1',
  },
  {
    original: 'images/bar1.jpg',
    thumbnail: 'images/bar1.jpg',
    description: 'Description de l\'image 2',
  },
  {
    original: 'images/bar3.jpg',
    thumbnail: 'images/bar3.jpg',
    description: 'Description de l\'image 3',
  },
  {
    original: 'images/bar4.jpg',
    thumbnail: 'images/bar4.jpg',
    description: 'Description de l\'image 4',
  },
  {
    original: 'images/bar5.jpg',
    thumbnail: 'images/bar5.jpg',
    description: 'Description de l\'image 5',
  },
  {
    original: 'images/bar2.jpg',
    thumbnail: 'images/bar2.jpg',
    description: 'Description de l\'image 6',
  },
];

function Gallery() {
  return (
    <div>
      <ImageGallery items={images} showPlayButton={false} showFullscreenButton={false} />
    </div>
  );
}

export default Gallery;
